import { Box, Heading, Text } from '@primer/react';
import { Header } from '../../components/Header/Header';
import { DataCard } from '../../components/DataCard/DataCard';
import { Chart } from '../../components/Chart/Chart';
import { TrendCard } from '../../components/TrendCard/TrendCard';

export function Home() {
  const cards = [
    {
      title: 'Total requests',
      data: '33.1k',
      description: 'Total amount of requests for this access token',
    },
    {
      title: 'Rate limited',
      data: '5.67%',
      description: 'Percentage of requests that were rate limited',
    },
  ];

  const trends = [
    {
      title: 'Top rate limited routes',
      description: 'Most used rate limited paths by this organization',
      data: [
        {
          value: '/graphql',
          count: '4.9k',
        },
        {
          value: '/repositories/repository_id/contents',
          count: '2.3k',
        },
        {
          value: '/graphql',
          count: '1.2k',
        },
        {
          value: '/graphql',
          count: '1.1k',
        },
        {
          value: '/graphql',
          count: '1.0k',
        },
      ],
    },
    {
      title: 'Top rate limited reasons',
      description: 'Most used rate limited paths by this organization',
      data: [
        {
          value: '/graphql',
          count: '4.9k',
        },
        {
          value: '/repositories/repository_id/contents',
          count: '2.3k',
        },
        {
          value: '/graphql',
          count: '1.2k',
        },
        {
          value: '/graphql',
          count: '1.1k',
        },
        {
          value: '/graphql',
          count: '1.0k',
        },
      ],
    },
  ];

  return (
    <Box
      sx={{
        width: '100%',
      }}
    >
      <Header />
      <Box
        sx={{
          display: 'flex',
          gap: 3,
        }}
      >
        {cards.map((card, index) => (
          <DataCard
            key={index}
            title={card.title}
            data={card.data}
            description={card.description}
          />
        ))}
      </Box>
      <Chart />
      <Box
        sx={{
          display: 'flex',
          gap: 3,
        }}
      >
        {trends.map((trend, index) => (
          <TrendCard
            title={trend.title}
            data={trend.data}
            description={trend.description}
          />
        ))}
      </Box>
    </Box>
  );
}
